import { useState } from 'react';
import { Link } from 'react-router-dom';
import Button from "./Button";
import Checkbox from "./Checkbox";
import Form from "./Form";
import TextInput from "./TextInput";

export default function SignupForm() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [agree, setAgree] = useState('');

  return(
    <Form style={{height: '500px'}}>
      <TextInput type="text" placeholder="Input name" icon="person" />

      <TextInput type="text" placeholder="Input email" icon="alternate_email" />

      <TextInput type="password" placeholder="Input password" icon="lock" />

      <TextInput type="password" placeholder="Confirm password" icon="lock_clock" />

      <Checkbox type="checkbox" text="I agree to the Terms & Conditions" />

      <Button>
        <span>Submit now</span>
      </Button>

      <div className="info">
        Already have an account? <Link to="/login">Login</Link> instead.
      </div>
    </Form>
  );
}
